cy. This is not supported and you will not be able to switch it on.','none'),(2286,'','default','sort icon','none'),(2287,'','default','sort ascending','none'),(2288,'','default','sort descending','none'),(2289,'','default','The following errors must be resolved before you can continue the installation process','none'),(2290,'','default','The following error must be resolved before you can continue the installation process','none'),(2291,'','default','Please check the error messages and <a href=\"!url\">try again</a>.','none'),(2292,'','default','The following installation warnings should be carefully reviewed','none'),(2293,'','default','The following installation warning should be carefully reviewed','none'),(2294,'','default','The following installation warnings should be carefully reviewed, but in most cases may be safely ignored','none'),(2295,'','default','The following installation warning should be carefully reviewed, but in most cases may be safely ignored','none'),(2296,'','default','The PCRE library in your PHP installation is outdated. This will cause problems when handling Unicode text. If you are running PHP 4.3.3 or higher, make sure you are using the PCRE library supplied by PHP. Please refer to the <a href=\"@url\">PHP PCRE documentation</a> for more information.','none'),(2297,'','default','Operations on Unicode strings are emulated on a best-effort basis. Install the <a href=\"@url\">PHP mbstring extension</a> for improved Unicode support.','none'),(2298,'','default','Multibyte string function overloading in PHP is active and must be disabled. Check the php.ini <em>mbstring.func_overload</em> setting. Please refer to the <a href=\"@url\">PHP mbstring documentation</a> for more information.','none'),(2299,'','default','Multibyte string input conversion in PHP is active and must be disabled. Check the php.ini <em>mbstring.encoding_translation</em> setting. Please refer to the <a href=\"@url\">PHP mbstring documentation</a> for more information.','no