t removed by Drupal.)','none'),(2322,'','default','Category selection type','none'),(2323,'','default','checkboxes','none'),(2324,'','default','multiple selector','none'),(2325,'','default','The type of category selection widget displayed on categorization pages. (For a small number of categories, checkboxes are easier to use, while a multiple selector work well with large numbers of categories.)','none'),(2326,'','default','Thousands of sites (particularly news sites and blogs) publish their latest headlines and posts in feeds, using a number of standardized XML-based formats. Formats supported by the aggregator include <a href=\"@rss\">RSS</a>, <a href=\"@rdf\">RDF</a>, and <a href=\"@atom\">Atom</a>.','none'),(2327,'','default','Current feeds are listed below, and <a href=\"@addfeed\">new feeds may be added</a>. For each feed or feed category, the <em>latest items</em> block may be enabled at the <a href=\"@block\">blocks administration page</a>.','none'),(2328,'','default','Add a feed in RSS, RDF or Atom format. A feed may only have one entry.','none'),(2329,'','default','Categories allow feed items from different feeds to be grouped together. For example, several sport-related feeds may belong to a category named <em>Sports</em>. Feed items may be grouped automatically (by selecting a category when creating or editing a feed) or manually (via the <em>Categorize</em> page available from feed item listings). Each category provides its own feed page and block.','none'),(2330,'','default','No blocks in this region','none'),(2331,'','default','Blocks are boxes of content rendered into an area, or region, of a web page. The default theme Garland, for example, implements the regions \"left sidebar\", \"right sidebar\", \"content\", \"header\", and \"footer\", and a block may appear in any one of these areas. The <a href=\"@blocks\">blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions.','none'),(2332,'','default','Although blocks are usually generated automatically by modules (like the <em>User login</em> block, for example), administrators can also define custom blocks. Custom blocks have a title, description, and body. The body of the block can be as long as necessary, and can contain content supported by any available <a href=\"@input-format\">input format</a>.','none'),(2333,'','default','When working with blocks, remember that:','none'),(2334,'','default','since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis.','none'),(2335,'','default','disabled blocks, or blocks not in a region, are never shown.','none'),(2336,'','default','when throttle module is enabled, throttled blocks (blocks with the <em>Throttle</em> checkbox selected) are hidden during high server loads.','none'),(2337,'','default','blocks can be configured to be visible only on certain pages.','none'),(2338,'','default','blocks can be configured to be visible only when specific conditions are true.','none'),(2339,'','default','blocks can be configured to be visible only for certain user roles.','none'),(2340,'','default','when allowed by an administrator, specific blocks may be enabled or disabled on a per-user basis using the <em>My account</em> page.','none'),(2341,'','default','some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','none'),(2342,'','default','For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','none'),(2343,'','default','This page provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. To change the region or order of a block, grab a drag-and-drop handle under the <em>Block</em> column and drag the block to a new location in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis. Remember that your changes will not be saved until you click the <em>Save blocks</em> button at the bottom of the page.','none'),(2344,'','default','To reduce CPU usage, database traffic or bandwidth, blocks may be automatically disabled during high server loads by selecting their <em>Throttle</em> checkbox. Adjust throttle thresholds on the <a href=\"@throttleconfig\">throttle configuration page</a>.','none'),(2345,'','default','Click the <em>configure</em> link next to each block to configure its specific title and visibility settings. Use the <a href=\"@add-block\">add block page</a> to create a custom block.','none'),(2346,'','default','Use this page to create a new custom block. New blocks are disabled by default, and must be moved to a region on the <a href=\"@blocks\">blocks administration page</a> to be visible.','none'),(2347,'','default','The block %info was assigned to the invalid region %region and has been disabled.','none'),(2348,'','default','Post new blog entry.','none'),(2349,'','default','You are not allowed to post a new blog entry.','none'),(2350,'','default','You have not created any blog entries.','none'),(2351,'','default','!author has not created any blog entries.','none'),(2352,'','default','Create new blog entry.','none'),(2353,'','default','No blog entries have been created.','none'),(2354,'','default','Blog entry','none'),(2355,'','default','A <em>blog entry</em> is a single post to an online journal, or <em>blog</em>.','none'),(2356,'','default','View recent blog entries','none'),(2357,'','default','The blog module allows registered users to maintain an online journal, or <em>blog</em>. Blogs are made up of individual <em>blog entries</em>, and the blog entries are most often displayed in descending order by creation time.','none'),(2358,'','default','There is an (optional) <em>Blogs</em> menu item added to the Navigation menu, which displays all blogs available on your site, and a <em>My blog</em> item displaying the current user\'s blog entries. The <em>Blog entry</em> menu item under <em>Create content</em> allows new blog entries to be created.','none'),(2359,'','default','Each blog entry is displayed with an automatic link to other blogs created by the same user. By default, blog entries have comments enabled and are automatically promoted to the site front page. The blog module also creates a <em>Recent blog posts</em> block that may be enabled at the <a href=\"@blocks\">blocks administration page</a>.','none'),(2360,'','default','When using the aggregator module an automatic <em>blog it</em> icon is displayed next to the items in a feed\'s <em>latest items</em> block. Clicking this icon populates a <em>blog entry</em> with a title (the title of the feed item) and body (a link to the source item on its original site and illustrative content suitable for use in a block quote). Blog authors can use this feature to easily comment on items of interest that appear in aggregator feeds from other sites. To use this feature, be sure to <a href=\"@modules\">enable</a> the aggregator module, <a href=\"@feeds\">add and configure</a> a feed from another site, and <a href=\"@blocks\">position</a> the feed\'s <em>latest items</em> block.','none'),(2361,'','default','For more information, see the online handbook entry for <a href=\"@blog\">Blog module</a>.','none'),(2362,'','default','!username\'s blog','none'),(2363,'','default','Read the latest blog entries.','none'),(2364,'','default','Enables keeping easily and regularly updated user web pages or blogs.','none'),(2365,'','default','Allowed book outline types','none'),(2366,'','default','Select content types which users with the %add-perm permission will be allowed to add to the book hierarchy. Users with the %outline-perm permission can add all content types.','none'),(2367,'','default','Default child page type','none'),(2368,'','default','The content type for the %add-child link must be one of those selected as an allowed book outline type.','none'),(2369,'','default','Save book pages','none'),(2370,'','default','Title changed from %original to %current.','none'),(2371,'','default','Updated book %title.','none'),(2372,'','default','book: updated %title.','none'),(2373,'','default','Update book outline','none'),(2374,'','default','Remove from book outline','none'),(2375,'','default','No changes were made','none'),(2376,'','default','The post has been added to the selected book. You may now position it relative to other pages.','none'),(2377,'','default','The book outline has been updated.','none'),(2378,'','default','There was an error adding the post to the book.','none'),(2379,'','default','%title has associated child pages, which will be relocated automatically to maintain their connection to the book. To recreate the hierarchy (as it was before removing this page), %title may be added again using the Outline tab, and each of its former child pages will need to be relocated manually.','none'),(2380,'','default','%title may be added to hierarchy again using the Outline tab.','none'),(2381,'','default','Are you sure you want to remove %title from the book hierarchy?','none'),(2382,'','default','The post has been removed from the book.','none'),(2383,'','default','Show a printer-friendly version of this book page and its sub-pages.','none'),(2384,'','default','Show block on all pages','none'),(2385,'','default','Show block only on book pages','none'),(2386,'','default','If <em>Show block on all pages</em> is selected, the block will contain the automatically generated menus for all of the site\'s books. If <em>Show block only on book pages</em> is selected, the block will contain only the one menu corresponding to the current page\'s book. In this case, if the current page is not in a book, no block will be displayed. The <em>Page specific visibility settings</em> or other visibility settings can be used in addition to selectively display this block.','none'),(2387,'','default','This is the top-level page in this book.','none'),(2388,'','default','No book selected.','none'),(2389,'','default','The parent page in the book. The maximum depth for a book and all child pages is !maxdepth. Some pages in the selected book may not be available as parents if selecting them would exceed this limit.','none'),(2390,'','default','%title is part of a book outline, and has associated child pages. If you proceed with deletion, the child pages will be relocated automatically.','none'),(2391,'','default','The book module is suited for creating structured, multi-page hypertexts such as site resource guides, manuals, and Frequently Asked Questions (FAQs). It permits a document to have chapters, sections, subsections, etc. Authors with suitable permissions can add pages to a collaborative book, placing them into the existing document by adding them to a table of contents menu.','none'),(2392,'','default','Pages in the book hierarchy have navigation elements at the bottom of the page for moving through the text. These links lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. More comprehensive navigation may be provided by enabling the <em>book navigation block</em> on the <a href=\"@admin-block\">blocks administration page</a>.','none'),(2393,'','default','Users can select the <em>printer-friendly version</em> link visible at the bottom of a book page to generate a printer-friendly display of the page and all of its subsections. ','none'),(2394,'','default','Users with the <em>administer book outlines</em> permission can add a post of any content type to a book, by selecting the appropriate book while editing the post or by using the interface available on the post\'s <em>outline</em> tab.','none'),(2395,'','default','Administrators can view a list of all books on the <a href=\"@admin-node-book\">book administration page</a>. The <em>Outline</em> page for each book allows section titles to be edited or rearranged.','none'),(2396,'','default','For more information, see the online handbook entry for <a href=\"@book\">Book module</a>.','none'),(2397,'','default','The book module offers a means to organize a collection of related posts, collectively known as a book. When viewed, these posts automatically display links to adjacent book pages, providing a simple navigation system for creating and reviewing structured content.','none'),(2398,'','default','The outline feature allows you to include posts in the <a href=\"@book\">book hierarchy</a>, as well as move them within the hierarchy or to <a href=\"@book-admin\">reorder an entire book</a>.','none'),(2399,'','default','Book page','none'),(2400,'','default','A <em>book page</em> is a page of content, organized into a collection of related entries collectively known as a <em>book</em>. A <em>book page</em> automatically displays links to adjacent pages, providing a simple navigation system for organizing and reviewing structured content.','none'),(2401,'','default','Allows users to structure site pages in a hierarchy or outline.','none'),(2402,'','default','The color module allows a site administrator to quickly and easily change the color scheme of certain themes. Although not all themes support color module, both Garland (the default theme) and Minnelli were designed to take advantage of its features. By using color module with a compatible theme, you can easily change the color of links, backgrounds, text, and other theme elements. Color module requires that your <a href=\"@url\">file download method</a> be set to public.','none'),(2403,'','default','It is important to remember that color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, you must save your color settings again, even if they haven\'t changed. This causes the color module generated version of the stylesheets in the files directory to be recreated using the new version of the original file.','none'),(2404,'','default','To change the color settings for a compatible theme, select the \"configure\" link for the theme on the <a href=\"@themes\">themes administration page</a>.','none'),(2405,'','default','For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.','none'),(2406,'','default','The color picker only works if the <a href=\"@url\">download method</a> is set to public.','none'),(2407,'','default','Base color','none'),(2408,'','default','Header top','none'),(2409,'','default','Header bottom','none'),(2410,'','default','There is not enough memory available to PHP to change this theme\'s color scheme. You need at least %size more. Check the <a href=\"@url\">PHP documentation</a> for more information.','none'),(2411,'','default','The GD library for PHP is enabled, but was compiled without PNG support. Please check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','none'),(2412,'','default','Allows the user to change the color scheme of certain themes.','none'),(2413,'','default','The comment module allows visitors to comment on your posts, creating ad hoc discussion boards. Any <a href=\"@content-type\">content type</a> may have its <em>Default comment setting</em> set to <em>Read/Write</em> to allow comments, or <em>Disabled</em>, to prevent comments. Comment display settings and other controls may also be customized for each content type (some display settings are customizable by individual users).','none'),(2414,'','default','Delete the selected comments','none'),(2415,'','default','Allows users to comment on and discuss published content.','none'),(2416,'','default','Example: \'website feedback\' or \'product information\'.','none'),(2417,'','default','When listing categories, those with lighter (smaller) weights get listed before categories with heavier (larger) weights. Categories with equal weights are sorted alphabetically.','none'),(2418,'','default','Contact form: category %category deleted.','none'),(2419,'','default','The contact form has not been configured. <a href=\"@add\">Add one or more categories</a> to the form.','none'),(2420,'','default','The contact module facilitates communication via e-mail, by allowing your site\'s visitors to contact one another (personal contact forms), and by providing a simple way to direct messages to a set of administrator-defined recipients (the <a href=\"@contact\">contact page</a>). With either form, users specify a subject, write their message, and (optionally) have a copy of their message sent to their own e-mail address.','none'),(2421,'','default','Personal contact forms allow users to be contacted via e-mail, while keeping recipient e-mail addresses private. Users may enable or disable their personal contact forms by editing their <em>My account</em> page. If enabled, a <em>Contact</em> tab leading to their personal contact form is available on their user profile. Site administrators have access to all personal contact forms (even if they have been disabled). The <em>Contact</em> tab is only visible when viewing another user\'s profile (users do not see their own <em>Contact</em> tab).','none'),(2422,'','default','A link to your site\'s <a href=\"@contact\">contact page</a> from the main <em>Navigation</em> menu is created, but is disabled by default. Create a similar link on another menu by adding a menu item pointing to the path \"contact\"','none'),(2423,'','default','Customize the <a href=\"@contact\">contact page</a> with additional information (like physical location, mailing address, and telephone number) using the <a href=\"@contact-settings\">contact form settings page</a>. The <a href=\"@contact-settings\">settings page</a> also provides configuration options for the maximum number of contact form submissions a user may perform per hour, and the default status of users\' personal contact forms.','none'),(2424,'','default','For more information, see the online handbook entry for <a href=\"@contact\">Contact module</a>.','none'),(2425,'','default','The contact module also adds a <a href=\"@menu-settings\">menu item</a> (disabled by default) to the navigation block.','none'),(2426,'','default','Personal contact form','none'),(2427,'','default','Allow other users to contact you by e-mail via <a href=\"@url\">your personal contact form</a>. Note that while your e-mail address is not made public to other members of the community, privileged users such as site administrators are able to contact you even if you choose not to enable this feature.','none'),(2428,'','default','Edit contact category','none'),(2429,'','default','Enables the use of both personal and site-wide contact forms.','none'),(2430,'','default','Discard log entries above the following row limit','none'),(2431,'','default','The maximum number of rows to keep in the database log. Older entries will be automatically discarded. (Requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.)','none'),(2432,'','default','The dblog module monitors your system, capturing system events in a log to be reviewed by an authorized individual at a later time. This is useful for site administrators who want a quick overview of activities on their site. The logs also record the sequence of events, so it can be useful for debugging site errors.','none'),(2433,'','default','The dblog log is simply a list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the dblog report on a regular basis to ensure their site is working properly.','none'),(2434,'','default','For more information, see the online handbook entry for <a href=\"@dblog\">Dblog module</a>.','none'),(2435,'','default','The dblog module monitors your website, capturing system events in a log to be reviewed by an authorized individual at a later time. The dblog log is simply a list of recorded events containing usage data, performance data, errors, warnings and operational information. It is vital to check the dblog report on a regular basis as it is often the only way to tell what is going on.','none'),(2436,'','default','Database logging','none'),(2437,'','default','Logs and records system events to the database.','none'),(2438,'','default','All roles may use default format','none'),(2439,'','default','No roles may use this format','none'),(2440,'','default','Set default format','none'),(2441,'','default','Default format updated.','none'),(2442,'','default','All roles for the default format must be enabled and cannot be changed.','none'),(2443,'','default','Specify a unique name for this filter format.','none'),(2444,'','default','Choose which roles may use this filter format. Note that roles with the \"administer filters\" permission can always use all the filter formats.','none'),(2445,'','default','Choose the filters that will be used in this filter format.','none'),(2446,'','default','No guidelines available.','none'),(2447,'','default','These are the guidelines that users will see for posting in this input format. They are automatically generated from the filter settings.','none'),(2448,'','default','Filter format names need to be unique. A format named %name already exists.','none'),(2449,'','default','Added input format %format.','none'),(2450,'','default','The input format settings have been updated.','none'),(2451,'','default','Are you sure you want to delete the input format %format?','none'),(2452,'','default','If you have any content left in this input format, it will be switched to the default input format. This action cannot be undone.','none'),(2453,'','default','The default format cannot be deleted.','none'),(2454,'','default','Deleted input format %format.','none'),(2455,'','default','Configure %format','none'),(2456,'','default','No settings are available.','none'),(2457,'','default','Rearrange %format','none'),(2458,'','default','The filter ordering has been saved.','none'),(2459,'','default','Each input format uses filters to manipulate text, and most input formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes or transforms elements within user-entered text before it is displayed. A filter does not change the actual content of a post, but instead, modifies it temporarily before it is displayed. A filter may remove unapproved HTML tags, for instance, while another automatically adds HTML to make links referenced in text clickable.','none'),(2460,'','default','Users can choose between the available input formats when creating or editing content. Administrators can configure which input formats are available to which user roles, as well as choose a default input format.','none'),(2461,'','default','For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','none'),(2462,'','default','Use the list below to configure which input formats are available to which roles, as well as choose a default input format (used for imported content, for example). The default format is always available to users. All input formats are available to users in a role with the \"administer filters\" permission.','none'),(2463,'','default','If you cannot find the settings for a certain filter, make sure you have enabled it on the <a href=\"@url\">view tab</a> first.','none'),(2464,'','default','Allowed HTML tags: @tags','6.22'),(2465,'','default','Anchors are used to make links to other pages.','none'),(2466,'','default','By default line break tags are automatically added, so use this tag to add additional ones. Use of this tag is different because it is not used with an open/close pair like all the others. Use the extra \" /\" inside the tag to maintain XHTML 1.0 compatibility','none'),(2467,'','default','Text with <br />line break','none'),(2468,'','default','By default paragraph tags are automatically added, so use this tag to add additional ones.','none'),(2469,'','default','Paragraph one.','none'),(2470,'','default','Paragraph two.','none'),(2471,'','default','Strong','none'),(2472,'','default','Emphasized','none'),(2473,'','default','Cited','none'),(2474,'','default','Coded text used to show programming source code','none'),(2475,'','default','Coded','none'),(2476,'','default','Bolded','none'),(2477,'','default','Italicized','none'),(2478,'','default','<sup>Super</sup>scripted','none'),(2479,'','default','<sub>Sub</sub>scripted','none'),(2480,'','default','Block quoted','none'),(2481,'','default','Quoted inline','none'),(2482,'','default','Table header','none'),(2483,'','default','Table cell','none'),(2484,'','default','Ordered list - use the &lt;li&gt; to begin each list item','none'),(2485,'','default','First item','none'),(2486,'','default','Second item','none'),(2487,'','default','Unordered list - use the &lt;li&gt; to begin each list item','none'),(2488,'','default','First term','none'),(2489,'','default','First definition','none'),(2490,'','default','Second term','none'),(2491,'','default','Second definition','none'),(2492,'','default','Subtitle three','none'),(2493,'','default','Subtitle four','none'),(2494,'','default','Subtitle five','none'),(2495,'','default','Subtitle six','none'),(2496,'','default','Tag Description','none'),(2497,'','default','You Type','none'),(2498,'','default','You Get','none'),(2499,'','default','No help provided for tag %tag.','none'),(2500,'','default','Ampersand','none'),(2501,'','default','Quotation mark','none'),(2502,'','default','Character Description','none'),(2503,'','default','No HTML tags allowed','none'),(2504,'','default','Lines and paragraphs break automatically.','6.22'),(2505,'','default','Lines and paragraphs are automatically recognized. The &lt;br /&gt; line break, &lt;p&gt; paragraph and &lt;/p&gt; close paragraph tags are inserted automatically. If paragraphs are not recognized simply add a couple blank lines.','none'),(2506,'','default','Web page addresses and e-mail addresses turn into links automatically.','6.22'),(2507,'','default','HTML filter','6.22'),(2508,'','default','HTML corrector','6.22'),(2509,'','default','Allows you to restrict whether users can post HTML and which tags to filter out. It will also remove harmful content such as JavaScript events, JavaScript URLs and CSS styles from those tags that are not removed.','none'),(2510,'','default','Converts line breaks into HTML (i.e. &lt;br&gt; and &lt;p&gt; tags).','none'),(2511,'','default','Turns web and e-mail addresses into clickable links.','none'),(2512,'','default','Corrects faulty and chopped off HTML in postings.','none'),(2513,'','default','How to deal with HTML tags in user-contributed content. If set to \"Strip disallowed tags\", dangerous tags are removed (see below). If set to \"Escape tags\", all HTML is escaped and presented as it was typed.','none'),(2514,'','default','If \"Strip disallowed tags\" is selected, optionally specify tags which should not be stripped. JavaScript event attributes are always stripped.','none'),(2515,'','default','Display HTML help','none'),(2516,'','default','If enabled, Drupal will display some basic HTML help in the long filter tips.','none'),(2517,'','default','Handles the filtering of content in preparation for display.','none'),(2518,'','default','Short but meaningful name for this collection of threaded discussions.','none'),(2519,'','default','Description and guidelines for discussions within this forum.','none'),(2520,'','default','Forums are displayed in ascending order by weight (forums with equal weights are displayed alphabetically).','none'),(2521,'','default','Short but meaningful name for this collection of related forums.','none'),(2522,'','default','Description and guidelines for forums within this container.','none'),(2523,'','default','Deleting a forum or container will also delete its sub-forums, if any. To delete posts in this forum, visit <a href=\"@content\">content administration</a> first. This action cannot be undone.','none'),(2524,'','default','The number of posts a topic must have to be considered \"hot\".','none'),(2525,'','default','Default number of forum topics displayed per page.','none'),(2526,'','default','Default display order for topics.','none'),(2527,'','default','There are no existing containers or forums. Containers and forums may be added using the <a href=\"@container\">add container</a> and <a href=\"@forum\">add forum</a> pages.','none'),(2528,'','default','Containers are usually placed at the top (root) level, but may also be placed inside another container or forum.','none'),(2529,'','default','Forums may be placed at the top (root) level, or inside another container or forum.','none'),(2530,'','default','The forum module lets you create threaded discussion forums with functionality similar to other message board systems. Forums are useful because they allow community members to discuss topics with one another while ensuring those conversations are archived for later reference. The <a href=\"@create-topic\">forum topic</a> menu item (under <em>Create content</em> on the Navigation menu) creates the initial post of a new threaded discussion, or thread.','none'),(2531,'','default','A threaded discussion occurs as people leave comments on a forum topic (or on other comments within that topic). A forum topic is contained within a forum, which may hold many similar or related forum topics. Forums are (optionally) nested within a container, which may hold many similar or related forums. Both containers and forums may be nested within other containers and forums, and provide structure for your message board. By carefully planning this structure, you make it easier for users to find and comment on a specific forum topic.','none'),(2532,'','default','When administering a forum, note that:','none'),(2533,'','default','a forum topic (and all of its comments) may be moved between forums by selecting a different forum while editing a forum topic.','none'),(2534,'','default','when moving a forum topic between forums, the <em>Leave shadow copy</em> option creates a link in the original forum pointing to the new location.','none'),(2535,'','default','selecting <em>Read only</em> under <em>Comment settings</em> while editing a forum topic will lock (prevent new comments) on the thread.','none'),(2536,'','default','selecting <em>Disabled</em> under <em>Comment settings</em> while editing a forum topic will hide all existing comments on the thread, and prevent new ones.','none'),(2537,'','default','For more information, see the online handbook entry for <a href=\"@forum\">Forum module</a>.','none'),(2538,'','default','By grouping related or similar forums, containers help organize forums. For example, a container named \"Food\" may hold two forums named \"Fruit\" and \"Vegetables\", respectively.','none'),(2539,'','default','A forum holds related or similar forum topics (a forum topic is the initial post to a threaded discussion). For example, a forum named \"Fruit\" may contain forum topics titled \"Apples\" and \"Bananas\", respectively.','none'),(2540,'','default','These settings allow you to adjust the display of your forum topics. The content types available for use within a forum may be selected by editing the <em>Content types</em> on the <a href=\"@forum-vocabulary\">forum vocabulary page</a>.','none'),(2541,'','default','Forum topic','none'),(2542,'','default','A <em>forum topic</em> is the initial post to a new discussion thread within a forum.','none'),(2543,'','default','You are not allowed to post new content in the forum.','none'),(2544,'','default','<a href=\"@login\">Login</a> to post new content in the forum.','none'),(2545,'','default','Enables threaded discussions about general topics.','none'),(2546,'','default','Manages the display of online help.','none'),(2547,'','default','The locale module allows your Drupal site to be presented in languages other than the default English, a defining feature of multi-lingual websites. The locale module works by examining text as it is about to be displayed: when a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for later review by a translator.','none'),(2548,'','default','Translations may be provided by:','none'),(2549,'','default','translating the original text via the locale module\'s integrated web interface, or','none'),(2550,'','default','For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','none'),(2551,'','default','Add all languages to be supported by your site. If your desired language is not available in the <em>Language name</em> drop-down, click <em>Custom language</em> and provide a language code and other details manually. When providing a language code manually, be sure to enter a standardized language code, since this code may be used by browsers to determine an appropriate display language.','6.22'),(2552,'','default','This page exports the translated strings used by your site. An export file may be in Gettext Portable Object (<em>.po</em>) form, which includes both the original string and the translation (used to share translations with others), or in Gettext Portable Object Template (<em>.pot</em>) form, which includes the original strings only (used to create new translations with a Gettext translation editor).','none'),(2553,'','default','This account\'s default language for e-mails.','none'),(2554,'','default','!long-month-name January','none'),(2555,'','default','!long-month-name February','none'),(2556,'','default','!long-month-name March','none'),(2557,'','default','!long-month-name April','none'),(2558,'','default','!long-month-name May','none'),(2559,'','default','!long-month-name June','none'),(2560,'','default','!long-month-name July','none'),(2561,'','default','!long-month-name August','none'),(2562,'','default','!long-month-name September','6.22'),(2563,'','default','!long-month-name November','none'),(2564,'','default','!long-month-name December','none'),(2565,'','default','Adds language handling functionality and enables the translation of the user interface to languages other than English.','none'),(2566,'','default','For more information, see the online handbook entry for <a href=\"@menu\">Menu module</a>.','none'),(2567,'','default','Menus are a collection of links (menu items) used to navigate a website. The menus currently available on your site are displayed below. Select a menu from this list to manage its menu items.','none'),(2568,'','default','The navigation menu is provided by Drupal and is the main interactive menu for any site. It is usually the only menu that contains personalized links for authenticated users, and is often not even visible to anonymous users.','none'),(2569,'','default','Primary links are often used at the theme layer to show the major sections of a site. A typical representation for primary links would be tabs along the top.','none'),(2570,'','default','Secondary links are often used for pages like legal notices, contact details, and other secondary navigation items that play a lesser role than primary links','none'),(2571,'','default','The human-readable name of this content type. This text will be displayed as part of the list on the <em>create content</em> page. It is recommended that this name begin with a capital letter and contain only letters, numbers, and <strong>spaces</strong>. This name must be unique.','none'),(2572,'','default','The machine-readable name of this content type. This text will be used for constructing the URL of the <em>create content</em> page for this content type. This name must contain only lowercase letters, numbers, and underscores. Underscores will be converted into hyphens when constructing the URL of the <em>create content</em> page. This name must be unique.','none'),(2573,'','default','The machine-readable name of this content type. This field cannot be modified for system-defined content types.','none'),(2574,'','default','A brief description of this content type. This text will be displayed as part of the list on the <em>create content</em> page.','none'),(2575,'','default','Submission form settings','none'),(2576,'','default','This content type does not have a title field.','none'),(2577,'','default','To omit the body field for this content type, remove any text and leave this field blank.','none'),(2578,'','default','This text will be displayed at the top of the submission form for this content type. It is useful for helping or instructing your users.','none'),(2579,'','default','Users with the <em>administer nodes</em> permission will be able to override these options.','none'),(2580,'','default','The machine-readable name %type is already taken.','none'),(2581,'','default','Invalid machine-readable name. Please enter a name other than %invalid.','none'),(2582,'','default','The human-readable name %name is already taken.','none'),(2583,'','default','The content type %name has been reset to its default values.','none'),(2584,'','default','Added content type %name.','none'),(2585,'','default','<strong>Warning:</strong> there is currently 1 %type post on your site. It may not be able to be displayed or edited correctly, once you have removed this content type.','none'),(2586,'','default','If the site is experiencing problems with permissions to content, you may have to rebuild the permissions cache. Possible causes for permission problems are disabling modules or configuration changes to permissions. Rebuilding will remove all privileges to posts, and replace them with permissions based on the current modules and settings.','none'),(2587,'','default','Rebuilding may take some time if there is a lot of content or complex permission settings. After rebuilding has completed posts will automatically use the new permissions.','none'),(2588,'','default','Node access status','none'),(2589,'','default','Number of posts on main page','none'),(2590,'','default','The default maximum number of posts to display per page on overview pages such as the main page.','none'),(2591,'','default','Are you sure you want to rebuild the permissions on site content?','none'),(2592,'','default','This action rebuilds all permissions on site content, and may be a lengthy process. This action cannot be undone.','none'),(2593,'','default','Demote from front page','6.22'),(2594,'','default','Make sticky','6.22'),(2595,'','default','Remove stickiness','6.22'),(2596,'','default','language','6.22'),(2597,'','default','An error occurred and processing did not complete.','none'),(2598,'','default','Show summary in full view','6.22'),(2599,'','default','The trimmed version of your post shows what your post looks like when promoted to the main page or when exported for syndication.<span class=\"no-js\"> You can insert the delimiter \"&lt;!--break--&gt;\" (without the quotes) to fine-tune where your post gets split.</span>','none'),(2600,'','default','Copy of the revision from %date.','none'),(2601,'','default','@type %title has been reverted back to the revision from %revision-date.','none'),(2602,'','default','Revision from %revision-date of @type %title has been deleted.','none'),(2603,'','default','@type: reverted %title revision %revision.','none'),(2604,'','default','The content access permissions need to be rebuilt.','none'),(2605,'','default','The content access permissions need to be rebuilt. Please visit <a href=\"@node_access_rebuild\">this page</a>.','none'),(2606,'','default','For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.','none'),(2607,'','default','Below is a list of all the content types on your site. All posts that exist on your site are instances of one of these content types.','6.22'),(2608,'','default','To create a new content type, enter the human-readable name, the machine-readable name, and all other relevant fields that are on this page. Once created, users of your site will be able to create posts that are instances of this content type.','none'),(2609,'','default','The revisions let you track differences between multiple versions of a post.','none'),(2610,'','default','<h1 class=\"title\">Welcome to your new Drupal website!</h1><p>Please follow these steps to set up and start using your website:</p>','6.22'),(2611,'','default','<strong>Configure your website</strong> Once logged in, visit the <a href=\"@admin\">administration section</a>, where you can <a href=\"@config\">customize and configure</a> all aspects of your website.','6.22'),(2612,'','default','<strong>Enable additional functionality</strong> Next, visit the <a href=\"@modules\">module list</a> and enable features which suit your specific needs. You can find additional modules in the <a href=\"@download_modules\">Drupal modules download section</a>.','6.22'),(2613,'','default','<strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\"@themes\">themes section</a>. You may choose from one of the included themes or download additional themes from the <a href=\"@download_themes\">Drupal themes download section</a>.','6.22'),(2614,'','default','<strong>Start posting content</strong> Finally, you can <a href=\"@content\">create content</a> for your website. This message will disappear once you have promoted a post to the front page.','6.22'),(2615,'','default','Rebuilding content access permissions','none'),(2616,'','default','Content permissions have been rebuilt.','none'),(2617,'','default','The content access permissions have not been properly rebuilt.','none'),(2618,'','default','Allows content to be submitted to the site and displayed on pages.','none'),(2619,'','default','This site supports <a href=\"@openid-net\">OpenID</a>, a secure way to log into many websites using a single username and password. OpenID can reduce the necessity of managing many usernames and passwords for many websites.','none'),(2620,'','default','To use OpenID you must first establish an identity on a public or private OpenID server. If you do not have an OpenID and would like one, look into one of the <a href=\"@openid-providers\">free public providers</a>. You can find out more about OpenID at <a href=\"@openid-net\">this website</a>.','none'),(2621,'','default','If you already have an OpenID, enter the URL to your OpenID server below (e.g. myusername.openidprovider.com). Next time you login, you will be able to use this URL instead of a regular username and password. You can have multiple OpenID servers if you like; just keep adding them here.','none'),(2622,'','default','OpenID is a secure method for logging into many websites with a single username and password. It does not require special software, and it does not share passwords with any site to which it is associated; including your site.','none'),(2623,'','default','Users can create accounts using their OpenID, assign one or more OpenIDs to an existing account, and log in using an OpenID. This lowers the barrier to registration, which is good for the site, and offers convenience and security to the users. OpenID is not a trust system, so email verification is still necessary. The benefit stems from the fact that users can have a single password that they can use on many websites. This means they can easily update their single password from a centralized location, rather than having to change dozens of passwords individually.','none'),(2624,'','default','The basic concept is as follows: A user has an account on an OpenID server. This account provides them with a unique URL (such as myusername.openidprovider.com). When the user comes to your site, they are presented with the option of entering this URL. Your site then communicates with the OpenID server, asking it to verify the identity of the user. If the user is logged into their OpenID server, the server communicates back to your site, verifying the user. If they are not logged in, the OpenID server will ask the user for their password. At no point does your site record, or need to record the user\'s password.','none'),(2625,'','default','More information on OpenID is available at <a href=\"@openid-net\">OpenID.net</a>.','none'),(2626,'','default','For more information, see the online handbook entry for <a href=\"@handbook\">OpenID module</a>.','none'),(2627,'','default','Allows users to log into your site using OpenID.','none'),(2628,'','default','No URL aliases found.','none'),(2629,'','default','No URL aliases available.','none'),(2630,'','default','Update alias','none'),(2631,'','default','Create new alias','none'),(2632,'','default','The alias %alias is already in use in this language.','none'),(2633,'','default','The alias has been saved.','none'),(2634,'','default','Are you sure you want to delete path alias %title?','none'),(2635,'','default','Filter aliases','none'),(2636,'','default','The path module allows you to specify aliases for Drupal URLs. Such aliases improve readability of URLs for your users and may help internet search engines to index your content more effectively. More than one alias may be created for a given page.','none'),(2637,'','default','<p>Some examples of URL aliases are:</p>\n<ul>\n<li>user/login =&gt; login</li>\n<li>image/tid/16 =&gt; store</li>\n<li>taxonomy/term/7+19+20+21 =&gt; store/products/whirlygigs</li>\n<li>node/3 =&gt; contact</li>\n</ul>\n','none'),(2638,'','default','The path module enables appropriately permissioned users to specify an optional alias in all node input and editing forms, and provides an interface to view and edit all URL aliases. The two permissions related to URL aliasing are <em>administer url aliases</em> and <em>create url aliases</em>. ','none'),(2639,'','default','This module also provides user-defined mass URL aliasing capabilities, which is useful if you wish to uniformly use URLs different from the default. For example, you may want to have your URLs presented in a different language. Access to the Drupal source code on the web server is required to set up mass URL aliasing. ','none'),(2640,'','default','For more information, see the online handbook entry for <a href=\"@path\">Path module</a>.','none'),(2641,'','default','Drupal provides complete control over URLs through aliasing, which is often used to make URLs more readable or easy to remember. For example, the alias \'about\' may be mapped onto the post at the system path \'node/1\', creating a more meaningful URL. Each system path can have multiple aliases.','none'),(2642,'','default','Enter the path you wish to create the alias for, followed by the name of the new alias.','none'),(2643,'','default','The alias has been deleted.','none'),(2644,'','default','The path is already in use.','none'),(2645,'','default','Allows users to rename URLs.','none'),(2646,'','default','The PHP filter adds the ability to include PHP code in posts. PHP is a general-purpose scripting language widely-used for web development; the content management system used by this website has been developed using PHP.','none'),(2647,'','default','Through the PHP filter, users with the proper permission may include custom PHP code within a page of the site. While this is a powerful and flexible feature if used by a trusted user with PHP experience, it is a significant and dangerous security risk in the hands of a malicious user. Even a trusted user may accidentally compromise the site by entering malformed or incorrect PHP code. Only the most trusted users should be granted permission to use the PHP filter, and all PHP code added through the PHP filter should be carefully examined before use.','none'),(2648,'','default','<a href=\"@drupal\">Drupal.org</a> offers <a href=\"@php-snippets\">some example PHP snippets</a>, or you can create your own with some PHP experience and knowledge of the Drupal system.','none'),(2649,'','default','For more information, see the online handbook entry for <a href=\"@php\">PHP module</a>.','none'),(2650,'','default','You may post PHP code. You should include &lt;?php ?&gt; tags.','none'),(2651,'','default','Using custom PHP code','none'),(2652,'','default','Custom PHP code may be embedded in some types of site content, including posts and blocks. While embedding PHP code inside a post or block is a powerful and flexible feature when used by a trusted user with PHP experience, it is a significant and dangerous security risk when used improperly. Even a small mistake when posting PHP code may accidentally compromise your site.','none'),(2653,'','default','If you are unfamiliar with PHP, SQL, or Drupal, avoid using custom PHP code within posts. Experimenting with PHP may corrupt your database, render your site inoperable, or significantly compromise security.','none'),(2654,'','default','Notes:','none'),(2655,'','default','Remember to double-check each line for syntax and logic errors <strong>before</strong> saving.','none'),(2656,'','default','Statements must be correctly terminated with semicolons.','none'),(2657,'','default','Global variables used within your PHP code retain their values after your script executes.','none'),(2658,'','default','<code>register_globals</code> is <strong>turned off</strong>. If you need to use forms, understand and use the functions in <a href=\"@formapi\">the Drupal Form API</a>.','none'),(2659,'','default','Use a <code>print</code> or <code>return</code> statement in your code to output content.','none'),(2660,'','default','Develop and test your PHP code using a separate test script and sample database before deploying on a production site.','none'),(2661,'','default','Consider including your custom PHP code within a site-specific module or <code>template.php</code> file rather than embedding it directly into a post or block.','none'),(2662,'','default','Be aware that the ability to embed PHP code within content is provided by the PHP Filter module. If this module is disabled or deleted, then blocks and posts with embedded PHP may display, rather than execute, the PHP code.','none'),(2663,'','default','A basic example: <em>Creating a \"Welcome\" block that greets visitors with a simple message.</em>','none'),(2664,'','default','<p>Add a custom block to your site, named \"Welcome\". With its input format set to \"PHP code\" (or another format supporting PHP input), add the following in the Block body:</p>\n<pre>\nprint t(\'Welcome visitor! Thank you for visiting.\');\n</pre>','none'),(2665,'','default','<p>To display the name of a registered user, use this instead:</p>\n<pre>\nglobal $user;\nif ($user->uid) {\n  print t(\'Welcome @name! Thank you for visiting.\', array(\'@name\' => $user->name));\n}\nelse {\n  print t(\'Welcome visitor! Thank you for visiting.\');\n}\n</pre>','none'),(2666,'','default','PHP evaluator','none'),(2667,'','default','Executes a piece of PHP code. The usage of this filter should be restricted to administrators only!','none'),(2668,'','default','A !php-code input format has been created.','none'),(2669,'','default','The PHP module has been disabled. Please note that any existing content that was using the PHP filter will now be visible in plain text. This might pose a security risk by exposing sensitive information, if any, used in the PHP code.','none'),(2670,'','default','Allows embedded PHP code/snippets to be evaluated.','none'),(2671,'','default','The ping module is useful for notifying interested sites that your site has changed. It automatically sends notifications, or \"pings\", to the <a href=\"@external-http-pingomatic-com\">pingomatic</a> service about new or updated content. In turn, <a href=\"@external-http-pingomatic-com\">pingomatic</a> notifies other popular services, including weblogs.com, Technorati, blo.gs, BlogRolling, Feedster.com, and Moreover.','none'),(2672,'','default','The ping module requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','none'),(2673,'','default','For more information, see the online handbook entry for <a href=\"@ping\">Ping module</a>.','none'),(2674,'','default','Failed to notify pingomatic.com (site).','none'),(2675,'','default','Ping','none'),(2676,'','default','Alerts other sites when your site has been updated.','none'),(2677,'','default','Total votes: @votes','none'),(2678,'','default','The poll module can be used to create simple polls for site users. A poll is a simple, multiple choice questionnaire which displays the cumulative results of the answers to the poll. Having polls on the site is a good way to receive feedback from community members.','none'),(2679,'','default','When creating a poll, enter the question being posed, as well as the potential choices (and beginning vote counts for each choice). The status and duration (length of time the poll remains active for new votes) can also be specified. Use the <a href=\"@poll\">poll</a> menu item to view all current polls. To vote in or view the results of a specific poll, click on the poll itself.','none'),(2680,'','default','For more information, see the online handbook entry for <a href=\"@poll\">Poll module</a>.','none'),(2681,'','default','Most recent poll','none'),(2682,'','default','A <em>poll</em> is a question with a set of possible responses. A <em>poll</em>, once created, automatically provides a simple running count of the number of votes received for each response.','none'),(2683,'','default','Poll status','none'),(2684,'','default','When a poll is closed, visitors can no longer vote for it.','none'),(2685,'','default','After this period, the poll will be closed automatically.','none'),(2686,'','default','Votes for choice @n','none'),(2687,'','default','Negative values are not allowed.','none'),(2688,'','default','Your vote could not be recorded because you did not select any of the choices.','none'),(2689,'','default','Add another choice','none'),(2690,'','default','Vote count','none'),(2691,'','default','Profile fields have been updated.','none'),(2692,'','default','edit %title','none'),(2693,'','default','add new %type','none'),(2694,'','default','The name of the field. The form name is not shown to the user but used internally in the HTML code and URLs.\nUnless you know what you are doing, it is highly recommended that you prefix the form name with <code>profile_</code> to avoid name clashes with other fields. Spaces or any other special characters except dash (-) and underscore (_) are not allowed. An example name is \"profile_favorite_color\" or perhaps just \"profile_color\".','none'),(2695,'','default','A list of all options. Put each option on a separate line. Example options are \"red\", \"blue\", \"green\", etc.','none'),(2696,'','default','Hidden profile field, only accessible by administrators, modules and themes.','none'),(2697,'','default','Private field, content only available to privileged users.','none'),(2698,'','default','Public field, content shown on profile page but not used on member list pages.','none'),(2699,'','default','Public field, content shown on profile page and on member list pages.','none'),(2700,'','default','The weights define the order in which the form fields are shown. Lighter fields \"float up\" towards the top of the category.','none'),(2701,'','default','Form will auto-complete while user is typing.','none'),(2702,'','default','The specified form name contains one or more illegal characters. Spaces or any other special characters except dash (-) and underscore (_) are not allowed.','none'),(2703,'','default','The specified form name is reserved for use by Drupal.','none'),(2704,'','default','The specified category name is reserved for use by Drupal.','none'),(2705,'','default','The specified title is already in use.','none'),(2706,'','default','The specified name is already in use.','none'),(2707,'','default','A hidden field cannot be required.','none'),(2708,'','default','A hidden field cannot be set to visible on the user registration form.','none'),(2709,'','default','The field has been created.','none'),(2710,'','default','Are you sure you want to delete the field %field?','none'),(2711,'','default','This action cannot be undone. If users have entered values into this field in their profile, these entries will also be deleted. If you want to keep the user-entered data, instead of deleting the field you may wish to <a href=\"@edit-field\">edit this field</a> and change it to a hidden profile field so that it may only be accessed by administrators.','none'),(2712,'','default','The field %field has been deleted.','none'),(2713,'','default','Profile field %field added under category %category.','none'),(2714,'','default','Profile field %field deleted.','none'),(2715,'','default','User list','none'),(2716,'','default','The following types of fields can be added to a user profile:','none'),(2717,'','default','single-line textfield','none'),(2718,'','default','multi-line textfield','none'),(2719,'','default','checkbox','none'),(2720,'','default','list selection','none'),(2721,'','default','freeform list','none'),(2722,'','default','For more information, see the online handbook entry for <a href=\"@profile\">Profile module</a>.','none'),(2723,'','default','Author information','none'),(2724,'','default','Link to full user profile','none'),(2725,'','default','Profile fields to display','none'),(2726,'','default','Select which profile fields you wish to display in the block. Only fields designated as public in the <a href=\"@profile-admin\">profile field configuration</a> are available.','none'),(2727,'','default','View full user profile','none'),(2728,'','default','About %name','none'),(2729,'','default','Put each item on a separate line or separate them by commas. No HTML allowed.','none'),(2730,'','default','The value provided for %field is not a valid URL.','none'),(2731,'','default','Supports configurable user profiles.','none'),(2732,'','default',' The search index is not cleared but systematically updated to reflect the new settings. Searching will continue to work but new content won\'t be indexed until all existing content has been re-indexed. This action cannot be undone.','none'),(2733,'','default','The index will be rebuilt.','none'),(2734,'','default','Indexing status','none'),(2735,'','default','Indexing throttle','none'),(2736,'','default','Number of items to index per cron run','none'),(2737,'','default','The maximum number of items indexed in each pass of a <a href=\"@cron\">cron maintenance task</a>. If necessary, reduce the number of items to prevent timeouts and memory errors while indexing.','none'),(2738,'','default','Indexing settings','none'),(2739,'','default','<p><em>Changing the settings below will cause the site index to be rebuilt. The search index is not cleared but systematically updated to reflect the new settings. Searching will continue to work but new content won\'t be indexed until all existing content has been re-indexed.</em></p><p><em>The default settings should be appropriate for the majority of sites.</em></p>','none'),(2740,'','default','Minimum word length to index','none'),(2741,'','default','The number of characters a word has to be to be indexed. A lower setting means better search result ranking, but also a larger database. Each search query must contain at least one keyword that is this size (or longer).','none'),(2742,'','default','Simple CJK handling','none'),(2743,'','default','Whether to apply a simple Chinese/Japanese/Korean tokenizer based on overlapping sequences. Turn this off if you want to use an external preprocessor for this instead. Does not affect other languages.','none'),(2744,'','default','The search module adds the ability to search for content by keywords. Search is often the only practical way to find content on a large site, and is useful for finding both users and posts.','none'),(2745,'','default','To provide keyword searching, the search engine maintains an index of words found in your site\'s content. To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Indexing behavior can be adjusted using the <a href=\"@searchsettings\">search settings page</a>; for example, the <em>Number of items to index per cron run</em> sets the maximum number of items indexed in each pass of a <a href=\"@cron\">cron maintenance task</a>. If necessary, reduce this number to prevent timeouts and memory errors when indexing.','none'),(2746,'','default','For more information, see the online handbook entry for <a href=\"@search\">Search module</a>.','none'),(2747,'','default','The search engine maintains an index of words found in your site\'s content. To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Indexing behavior can be adjusted using the settings below.','none'),(2748,'','default','Search form','none'),(2749,'','default','Enables site-wide keyword searching.','none'),(2750,'','default','Total page generation time','none'),(2751,'','default','%time ms','none'),(2752,'','default','Top pages in the past %interval','none'),(2753,'','default','unban','none'),(2754,'','default','ban','none'),(2755,'','default','Top visitors in the past %interval','none'),(2756,'','default','Top referrers in the past %interval','none'),(2757,'','default','Log each page access. Required for referrer statistics.','none'),(2758,'','default','Older access log entries (including referrer statistics) will be automatically discarded. (Requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.)','none'),(2759,'','default','Content viewing counter settings','none'),(2760,'','default','Count content views','none'),(2761,'','default','Increment a counter each time content is viewed.','none'),(2762,'','default','The statistics module keeps track of numerous site usage statistics, including the number of times, and from where, each of your posts is viewed. These statistics are useful in determining how users are interacting with each other and with your site, and are required for the display of some Drupal blocks.','none'),(2763,'','default','The statistics module provides:','none'),(2764,'','default','a counter for each post on your site that increments each time the post is viewed. (Enable <em>Count content views</em> on the <a href=\"@accesslog\">access log settings page</a>, and determine if the post access counters should be visible to any user roles on the <a href=\"@permissions\">permissions page</a>.)','none'),(2765,'','default','a <a href=\"@recent-hits\">recent hits</a> log that displays information about the latest activity on your site, including the URL and title of the page accessed, the user name (if available) and IP address of the accessing party.','none'),(2766,'','default','a <a href=\"@top-referrers\">top referrers</a> log that displays the referring parties for your site visits (where your visitors came from).','none'),(2767,'','default','a <a href=\"@top-pages\">top pages</a> log that displays site content in descending order by number of views.','none'),(2768,'','default','a <a href=\"@top-visitors\">top visitors</a> log that displays the most active users on your site.','none'),(2769,'','default','a <em>Popular content</em> block that displays the day\'s most viewed content, the all-time most viewed content, and the last content viewed. (Enable the <em>Popular content</em> block on the <a href=\"@blocks\">blocks administration page</a>.)','none'),(2770,'','default','Configuring the statistics module','none'),(2771,'','default','When the <em>Enable access log</em> setting on the <a href=\"@accesslog\">access log settings page</a> is enabled, data about every page accessed (including the remote host\'s IP address, referrer, node accessed, and user name) is stored in the access log. The access log must be enabled for the <a href=\"@recent-hits\">recent hits</a>, <a href=\"@top-referrers\">top referrers</a>, <a href=\"@top-pages\">top pages</a>, and <a href=\"@top-visitors\">top visitors</a> log pages to function. Enabling the access log adds one additional database call per page displayed by Drupal.','none'),(2772,'','default','The <em>Discard access logs older than</em> setting on the <a href=\"@accesslog\">access log settings page</a> specifies the length of time entries are retained in the access log before they are deleted. Automatic access log entry deletion requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','none'),(2773,'','default','The <em>Count content views</em> setting on the <a href=\"@accesslog\">access log settings page</a> enables a counter for each post on your site that increments each time the post is viewed. This option must be enabled to provide post-specific access counts. Enabling this option adds one additional database call per each post displayed by Drupal.','none'),(2774,'','default','For more information, see the online handbook entry for <a href=\"@statistics\">Statistics module</a>.','none'),(2775,'','default','Settings for the statistical information that Drupal will keep about the site. See <a href=\"@statistics\">site statistics</a> for the actual information.','none'),(2776,'','default','This page displays the site\'s most recent hits.','none'),(2777,'','default','This page displays all external referrers, or external references to your website.','none'),(2778,'','default','When you ban a visitor, you prevent the visitor\'s IP address from accessing your site. Unlike blocking a user, banning a visitor works even for anonymous users. This is most commonly used to block resource-intensive bots or web crawlers.','none'),(2779,'','default','Popular content','none'),(2780,'','default','How many content items to display in \"all time\" list.','none'),(2781,'','default','How many content items to display in \"recently viewed\" list.','none'),(2782,'','default','Today\'s:','none'),(2783,'','default','All time:','none'),(2784,'','default','Last viewed:','none'),(2785,'','default','Logs access statistics for your site.','none'),(2786,'','default','The syslog module enables Drupal to send messages to the operating system\'s logging facility.','none'),(2787,'','default','Syslog is an operating system administrative logging tool, and provides valuable information for use in system management and security auditing. Most suited to medium and large sites, syslog provides filtering tools that allow messages to be routed by type and severity. On UNIX/Linux systems, the file /etc/syslog.conf defines this routing configuration; on Microsoft Windows, all messages are sent to the Event Log. For more information on syslog facilities, severity levels, and how to set up a syslog.conf file, see <a href=\"@syslog_conf\">UNIX/Linux syslog.conf</a> and PHP\'s <a href=\"@php_openlog\">openlog</a> and <a href=\"@php_syslog\">syslog</a> functions.','none'),(2788,'','default','For more information, see the online handbook entry for <a href=\"@syslog\">Syslog module</a>.','none'),(2789,'','default','Send events to this syslog facility','none'),(2790,'','default','Select the syslog facility code under which Drupal\'s messages should be sent. On UNIX/Linux systems, Drupal can flag its messages with the code LOG_LOCAL0 through LOG_LOCAL7; for Microsoft Windows, all messages are flagged with the code LOG_USER. Depending on the system configuration, syslog and other logging tools use this code to identify or filter Drupal messages from within the entire system log. For more information on syslog, see <a href=\"@syslog_help\">Syslog help</a>.','none'),(2791,'','default','LOG_USER - User level messages. Use this for Windows.','none'),(2792,'','default','LOG_LOCAL0 - Local 0','non