ying this value will break existing URLs and should be used with caution in a production environment.</strong> <em>Example: Specifying \"deutsch\" as the path prefix for German results in URLs in the form \"www.example.com/deutsch/node\".</em>','6.22'),(3534,'/zoooday/admin/settings/language/add','default','Language domain','6.22'),(3535,'/zoooday/admin/settings/language/add','default','Language-specific URL, with protocol. With language negotiation set to <em>Domain name only</em>, the site is presented in this language when the URL accessing the site references this domain. For the default language, this value may be left blank. <strong>This value must include a protocol as part of the string.</strong> <em>Example: Specifying \"http://example.de\" or \"http://de.example.com\" as language domains for German results in URLs in the forms \"http://example.de/node\" and \"http://de.example.com/node\", respectively.</em>','6.22'),(3536,'/zoooday/admin/settings/language/add','default','Direction that text in this language is presented.','6.22'),(3537,'/zoooday/admin/settings/language/add','default','Right to left','6.22'),(3538,'/zoooday/admin/settings/language/add','default','Add custom language','6.22'),(3539,'/zoooday/node/add/movies','default','Nothing has been selected.','6.22'),(3540,'/zoooday/node/add/movies','default','You have specified an invalid media URL or embed code.','6.22');

